import React from "react";
import {
  Card,
  CardBody,
  CardTitle,
  CardSubtitle,
  CardText,
  CardFooter,
  Button,
  Container,
} from "reactstrap";

 

function Course() {
  return (
    <>
      <Card className="text-center"> 
        <CardBody> 
        <CardTitle className="font-weight-bold">JAVA COURSE</CardTitle>
        <CardText>This is Java Course For Beginners</CardText>
        <Container className="text-center">
            <Button color="danger">Delete</Button>
            <Button color="warning  ">Update</Button>
        </Container>
        </CardBody>
      </Card>
    </>
  );
}
export default Course;
